        },
        {
          header: "bad news for gay",
          text: "your ass in shit",
        },
      ],
    },
  },
};

export let addNews = (headerNews, textNews) => {
  let newNews = {
    header: headerNews,
    text: textNews,
  };
  state.contain.advertising.news.push(newNews);
};

export default state;
